import OrderDetail from "./OrderDetail";
import BillingDetailForm from "./BillingDetailForm";

const CheckoutForm = () => {
  return (
    <>
      <div className="container">
        <div>
          <BillingDetailForm />
          <OrderDetail />
        </div>
      </div>
    </>
  );
};
export default CheckoutForm;
